INSERT INTO `settings` VALUES (2,'email_template_user_notification','&lt;p&gt;Dear ::name::,&lt;/p&gt;\n\n&lt;p&gt;Your work order was registered and will be looked upon shortly.&lt;/p&gt;\n\n&lt;p&gt;Thank You&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Basic user notification','Variables - ::name:: First and last name combination'),(3,'email_template_admin_notification','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;::first_name:: ::last_name:: Added a work order.\nPlease review!&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Admin Notification','Variables: ::username:: - admin username; ::first_name:: - the first name of the user; ::last_name:: - the last name of the user'),(4,'email_template_registration','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;Your registration was successfull.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Registration Email Template','Variables: ::username:: - username'),(5,'email_template_recovery_password','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;Reset your password by following this link: \n&lt;a href=::resetpw_link::&gt;::resetpw_link::&lt;/a&gt;&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Password Recovery Email Template','Variables: ::username:: - username, ::resetpw_link:: - recovery URL'),(6,'email_template_workorder_created','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;Your workorder was submitted.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Work Order Submit Notification Email Template','Variables: ::username:: - client username'),(7,'email_template_message_for_client','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;You have received a message related to your submitted work order.&lt;br&gt;\n\nThe message is:&lt;br&gt;\n\n&lt;strong&gt;::message::&lt;/strong&gt;\n&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Work Order Message for Client Email Template','Variables: ::username:: - client`s username, ::message:: - the message'),(8,'email_template_workorder_scheduled','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;The status of your workorder was changed for Scheduled.&lt;/p&gt;\n\n&lt;p&gt;Date when the inspection will be taken: ::schedule_date::&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Work Order Status Scheduled E-mail Template','Variables: ::username:: - username, ::schedule_date:: - inspection date'),(9,'email_template_workorder_alert','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;Your work-order status was changed for Alert!&lt;/p&gt;\n\n&lt;p&gt;Please check your account as soon as possible.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Workorder Status Alert E-mail Template','Variables: ::username::'),(10,'workorder_type_price_0','199.75','Work order type price - Basic Inspections',''),(11,'workorder_type_price_1','350.00','Work order type price - Expert Inspections',''),(12,'workorder_type_price_2','750.25','Work order type price - Engineer Reports',''),(13,'email_template_invoice','&lt;p&gt;Dear ::first_name:: ::last_name::,&lt;/p&gt;\n\n&lt;p&gt;You recieved an invoice.&lt;/p&gt;\n\n&lt;p&gt;You can view it in the attachments.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Email template for invoice','Variables: ::first_name:: - first name of the client, ::last_name:: - last name of the client'),(14,'email_template_inspection_completed','&lt;p&gt;Dear Administrator&lt;/p&gt;\n\n&lt;p&gt;Workorder ::workorder_id:: is completed.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Inspection Status Completed E-mail Template','Variables: ::workorder_id:: - Workorder ID'),(15,'email_template_generated_report','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;The generated report of your work order ::workorder_id:: is attached.&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Report Generation E-mail Template','Variables: ::username:: - client username, ::workorder_id:: - Workorder ID'),(16,'email_template_createuser','&lt;p&gt;Dear ::username::&lt;/p&gt;\n\n&lt;p&gt;New account created for you.&lt;/p&gt;\n\n&lt;p&gt;Your password is: ::password::&lt;/p&gt;\n\n&lt;p&gt;Regards,&lt;br&gt;\nTrinity Support&lt;/p&gt;','Create New User Email Template','Variables: ::username:: - username, ::password:: - password');
